import React from 'react'
import ekko from '../layout/background.jpeg'
const Portfolio = () => {
    return (
        <div className ="grid-3 bg-dark">
            <img
                src={ekko}
                style={{width: '500px', margin: 'right', display: 'flex'}}
                alt = 'Piece 1'
            />
            <div>1</div>
            <div>2</div>
            <div>3</div>
            <div>4</div>
        </div>  
    )
}

export default Portfolio
